// ==UserScript==
// @name         RottenTomatoes-TPB
// @namespace    pro
// @version      0.3
// @description  Add RT scores to TPB movies
// @author       arealprofressional
// @include      http*://*thepiratebay.org/*
// @match        http://*/*
// @grant        GM.xmlHttpRequest
// @require      http://code.jquery.com/jquery-3.4.1.min.js
// @downloadURL https://update.greasyfork.org/scripts/393420/RottenTomatoes-TPB.user.js
// @updateURL https://update.greasyfork.org/scripts/393420/RottenTomatoes-TPB.meta.js
// ==/UserScript==
//
(function() {
    'use strict';

    let rt = 'https://rottentomatoes.com';
    // Looks for a date in the TPB link to split on in order to find the movie name.
    let movieRegExp = /(19\d{2})|(200\d)|(201[0-9])/;
    let tvRegExp = /S\d{2}E\d{2}/;

    // base64 encoded images and gifs (prevents errors when cross-site trackers are blocked)
    // https://www.rottentomatoes.com/assets/pizza-pie/images/icons/tomatometer/certified_fresh.75211285dbb.svg
    const certifiedFresh = 'data:image/svg+xml;base64,'
    // https://www.rottentomatoes.com/assets/pizza-pie/images/icons/tomatometer/tomatometer-fresh.149b5e8adc3.svg
    const fresh = 'data:image/svg+xml;base64,'
    // https://www.rottentomatoes.com/assets/pizza-pie/images/icons/tomatometer/tomatometer-rotten.f1ef4f02ce3.svg
    const rotten = 'data:image/svg+xml;base64,'
    // https://www.rottentomatoes.com/assets/pizza-pie/images/icons/audience/aud_score-fresh.6c24d79faaf.svg
    const audienceFresh = 'data:image/svg+xml;base64,'
    // https://www.rottentomatoes.com/assets/pizza-pie/images/icons/audience/aud_score-rotten.f419e4046b7.svg
    const audienceRotten = 'data:image/svg+xml;base64,'
    // generated on loading.io
    const loadingGif = 'data:image/gif;base64,'

    // helper function to make a GET request to a given url
    let get = url => {
        return new Promise((resolve, reject) => {
            return GM.xmlHttpRequest({
                method: "GET",
                url: url,
                onload: function(r) {
                    if (r.status >= 200 && r.status < 300) {
                        resolve(r.responseText);
                    } else {
                        reject(r.status);
                    }
                },
                onerror: function(r) {
                    reject(r.status)
                }
            });
        });
    };

    let appendScoresToElement = (element, html, url) => {
        if (html) {
            // Check the tomatometer status.
            let image = null
            let meter = html.find('span.meter-tomato')

            if (meter.hasClass('certified_fresh')) {
                image = certifiedFresh
            }
            if (meter.hasClass('fresh')) {
                image = fresh
            }
            if (meter.hasClass('rotten')) {
                image = rotten
            }
            if (meter.hasClass('upright')) {
                image = audienceFresh
            }
            if (meter.hasClass('spilled')) {
                image = audienceRotten
            }

            // Append the image to the element.
            if (image) {
                element.append('<img class="scores" style="width: 30px; margin-right: 4px;" src="' + image + '"/>')
            }

            let percentage = html.find('.mop-ratings-wrap__percentage').text().trim()
            // Append the percentage and url to the element.
            element.append('<a class="scores" href="' + url + '" ' +
                'onMouseOver="this.style.color=\'#23527c\'" ' +
                'onMouseOut="this.style.color=\'#000\'" ' +
                'style="' +
                'color: #000;' +
                'font-family: sans-serif;' +
                'font-size: 20px;' +
                'margin-top: 10px;' +
                'text-decoration: none;">' +
                percentage + '</span>')

            // Wrap this in a span.
            element.find('.scores').wrapAll('<span class="inner"></span>')
        }
    };

    // takes in the element to edit, the response from RT, and the source url.
    // finds any relevant reviews of child elements in the html passed in, and appends RT scores to the self element.
    let process = (element, html, url) => {
        // remove all image tags - this prevents jQuery from creating DOM elements that attempt to load in the background.
        html = html.replace(/<img\b[^>]*>/ig, '');
        let reviews = ''

        /*
        * Critics reviews.
        */
        reviews = $($(html).find('a[href$="#contentReviews"]'))
        appendScoresToElement(element, reviews, url)

        /*
         * TV critics reviews.
         */
        reviews = $($(html).find('.critic-score'))
        appendScoresToElement(element, reviews, url)

        /*
         * Audience reviews.
         */
        reviews = $($(html).find('.audience-score'))
        appendScoresToElement(element, reviews, url)

        // Wrap all spans with class .inner in another span and float right. This will put all the above generated data to the right of the element.
        element.find('.inner').wrapAll('<span class="wrapper" style="float: right"></span>')
    };

    // This is really the main function that's doing everything.
    //
    // loop through each movie element and parse the html for reviews.
    $(".detName").each(function(e) {
        let element = $(this);
        let href = element.find('a')
        let year = ''
        let media = ''
        let isTvShow = href.text().match(tvRegExp)

        if (isTvShow) {
            // Split for TV shows...
            media = href.text().split(tvRegExp)[0];
        } else {
            // Split for movies...
            media = href.text().split(movieRegExp)[0];
            // If it's a movie we need to get the year in order to create a valid RT url.
            let match = href.text().match(movieRegExp);
            if (match && match.length > 0) {
               year = match[0];
            }
        }

        // string sanitization.
        media = media.replace(/\./g, ' ');
        media = media.replace(/\(/g, '');
        media = media.trim().replace(/\ /g, '_');

        // append a neat loading gif to the end of the movie element div to show us that something is happening.
        element.append('<img class="loader" style="float: right; width: 33px;" src="' + loadingGif + '"/>')

        // build the url and make calls to RT, depending on if media is a TV show or movie.
        let url = '';

        // If we're checking out a tv show only make one req to RT.
        if (isTvShow) {
            url += rt + '/tv/' + media
            get(url)
                .then(r => {
                    process(element, r, url);
                })
                .catch(error => {
                    console.log("error getting " + url + " [" + error + "]");
                })
                .finally(() => {
                    element.find('.loader').remove();
                });
        } else {
            // Now we're dealing with movies which are a bit weirder.
            url += rt + '/m/' + media
            if (year !== '') {
                // for many movies the RT url format is /m/<MOVIE_TITLE>_<MOVIE_YEAR>
                // so check that first. if we get a hit, great! ...
                url += '_' + year
                get(url)
                    .then(r => {
                        element.find('.loader').remove();
                        process(element, r, url);
                    })
                    .catch(error => {
                        // If there was an error with the previous format for movies, try /m/<MOVIE_TITLE>
                        console.log("error getting " + url + " [" + error + "]");
                        url = rt + '/m/' + media
                        get(url)
                            .then(r => {
                                process(element, r, url);
                            })
                            .catch(error => {
                                console.log("error getting " + url + " [" + error + "]");
                            })
                            .finally(() => {
                                element.find('.loader').remove();
                            });
                    })
            } else {
                // If there was no parsed year from the movie link, just get the movie from /m/<MOVIE_TITLE>
                get(url)
                    .then(r => {
                        process(element, r, url);
                    })
                    .catch(error => {
                        console.log("error getting " + url + " [" + error + "]");
                    })
                    .finally(() => {
                        element.find('.loader').remove();
                    });
            }
        }
    });
})();
